window.bookSummaryJSON = "<p><i>Come Back to Me</i> is a complete standalone romantic suspense featuring a grumpy veteran hero and a sunshine quirky musician heroine with plenty of groveling!</p> <p>Tee: I hate Butch because he let me go. Except I also love him because I imagined forever with him (even just as friends).</p> <p>So, basically, it sucks to be me.</p> <p>When my nonna tells me the only way to get over someone is to get under someone else, in strolls Cody Korhonen—my BFF’s brother-in-law.</p> <p>Romate. Town marshal. All-round good (delicious) guy.</p> <p>Getting under him may be easy, but staying under him might cost us everything.</p> <p>Cody: I fell in love with my pen pal, T. An initial on a piece of paper that kept me sane while I was deployed.</p> <p>To her, I was ‘Butch.’ My call sign. And with anonymity came safety—we opened our souls to one another.</p> <p>But war broke me, and I loved her enough to let her go.</p> <p>Life had other plans.</p> <p>When I return home, I find my sister-in-law’s best friend is the woman I fell in love with.</p> <p>And she just moved in.</p> <p>Our small town is too small for the both of us, never mind having to share a roof when this secret is driving me crazy.</p>"; 
